import React, { useEffect } from 'react';
import { ProductData } from './ProductsData';
import { useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Header from './Header';
import { ImHeartBroken } from 'react-icons/im';
import { RiPagesLine } from 'react-icons/ri';
import Button from 'react-bootstrap/Button';
import Navbar from './Navbar';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';

export default function RecomForm() {
  const [b, setB] = useState([]);
  const params = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`http://localhost:8080/recommendation/googleImages?q=${params.gender}`, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
        });

        if (response.ok) {
          const data = await response.json();
          setB(data);
        }
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, [params.gender]);

  const submit = () => {
    navigate(`/recommendation/${gender}/${event}/${color}/${type}`);
  };

  return (
    <div>
      <Header />
      <Navbar />
      <Container className="shadow">
        <Row>
          <p className="h1 text-success">Your Output</p>
        </Row>
        <hr />
        <Container>
          <Row>
            {b.map((item, index) => (
              <Card style={{ width: '18rem' }} className="m-3 shadow" key={index}>
                <Card.Img variant="top" src={item} />
                <Card.Body>
                  <Card.Title>{item.gender}</Card.Title>
                  <Button variant="border border-3" className="m-2" style={{ backgroundColor: 'rgba(248,153,61,255)' }}>
                    <ImHeartBroken />
                  </Button>
                  <Button variant="border border-3 bg-info m-2">
                    <RiPagesLine />
                  </Button>
                </Card.Body>
              </Card>
            ))}
          </Row>
        </Container>
      </Container>
    </div>
  );
}
